                 {/* <OpenProgram/> */}
                 {/* <EditProgram programId={this.state.programId}/> */}
         {/* <Dashboard/> */}
              {this.currentPage}

               </div>
                <div className="col-md-3 pr-1">
                {this.props.right}
               </div>
             </div>
             <div className="row">
               <div className="col-md-12 pr-1">                
                Footer 
               </div>
          </div>
          </div>


        </div>
      </div>
    );
  }

}
